export default function ProfileCard({ props }) {
  const user = {
    id: 7,
    email: "michael.lawson@reqres.in",
    first_name: "Michael",
    last_name: "Lawson",
    avatar: "https://reqres.in/img/faces/7-image.jpg",
  };

  return (
    <>
      <img src={user.avatar} alt="avatar" />
      <div>
        <h4>
          {user.first_name} {user.last_name}
        </h4>
        <p>{user.email}</p>
      </div>
    </>
  );
}
